import React, { Component } from 'react';
import './App.css';

import contacts from './contacts.json';

class App extends Component {
  render() {
    return (
      <div className="App">
        {contacts.map(singleContact => {
          return (
            <table>
              <thead>
                <tr>
                  <th colspan="2">The table header</th>
                </tr>
              </thead>
            </table>
          );
          // <div>{singleContact.name}</div>;
        })}
      </div>
    );
  }
}

export default App;
